import React, { useEffect, useState } from "react";

export default function Dashboard() {
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
  const token = localStorage.getItem("token");

  fetch("http://localhost:8000/api/jobs/jobright/", {
    headers: {
      "Authorization": `Bearer ${token}`,
      "Content-Type": "application/json"
    }
  })
    .then(res => res.json())
    .then(data => {
      console.log("Jobs:", data.jobs);
      setJobs(data.jobs || []);
    })
    .catch(err => console.error("Error fetching jobs:", err));
}, []);



  return (
    <div style={{ padding: "20px" }}>
      <h2>Latest Jobs</h2>

      <table style={{ width: "100%", borderCollapse: "collapse", marginTop: "20px" }}>
        <thead>
          <tr style={{ background: "#f5f5f5", textAlign: "left" }}>
            <th style={{ padding: "10px" }}>Role</th>
            <th style={{ padding: "10px" }}>Location</th>
            <th style={{ padding: "10px" }}>Published</th>
            <th style={{ padding: "10px" }}>Details</th>
            <th style={{ padding: "10px" }}>Apply</th>
          </tr>
        </thead>

        <tbody>
          {jobs.length === 0 ? (
            <tr>
              <td colSpan={5} style={{ padding: "20px", textAlign: "center" }}>
                No jobs found.
              </td>
            </tr>
          ) : (
            jobs.map((job, index) => (
              <tr key={index} style={{ borderBottom: "1px solid #ddd" }}>
                <td style={{ padding: "10px" }}>{job.title}</td>
                <td style={{ padding: "10px" }}>{job.location}</td>
                <td style={{ padding: "10px" }}>{job.published}</td>

                <td style={{ padding: "10px" }}>
                  <a
                    href={job.url}
                    target="_blank"
                    rel="noopener noreferrer"
                    style={{
                      padding: "6px 12px",
                      background: "#007bff",
                      color: "white",
                      borderRadius: "5px",
                      textDecoration: "none",
                    }}
                  >
                    View
                  </a>
                </td>

                <td style={{ padding: "10px" }}>
                  <a
                    href={job.url}
                    target="_blank"
                    rel="noopener noreferrer"
                    style={{
                      padding: "6px 12px",
                      background: "#28a745",
                      color: "white",
                      borderRadius: "5px",
                      textDecoration: "none",
                    }}
                  >
                    Apply
                  </a>
                </td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
}
